import React from "react";
import Footer from "../components/Footer";
import Header from "../components/Header";
import InputTxt from "../components/Cyber-input-txt";
import Cyberbutton from "../components/Cyber-buttons";
import { NavLink } from 'react-router-dom';

const Login = () => {
    return(
        <div className="Login">
            <Header/>
                <div className="row">
                    <div className="card-cyberpunk" >
                        <h1 >Welcome to Heimdall</h1>
                    </div>
                <div className="card-cyberpunk-wrapper">
                    <h1 >Login</h1>
                    <InputTxt name="Username"/>
                    <Cyberbutton name="Login" tags="j117"/>
                    <button className="cybr-btn">
                        Forgot password?<span>_</span>
                        <span className="cybr-btn__glitch">Forgot password?_</span>
                        <span className="cybr-btn__tag">J117</span>
                    </button>
                    <NavLink exact to="./Register">
                    <button className="cybr-btn">
                        Sign-up<span>_</span>
                        <span className="cybr-btn__glitch">Sign-up_</span>
                        <span className="cybr-btn__tag">J117</span>
                    </button>
                    </NavLink>
                </div>
            </div>
            <Footer/>
        </div>
    );
}

export default Login;
